News._virtualQueryString:
function (sym, callback) {
    var API_URL = "https://api.iextrading.com/1.0/stock/" + sym + "/news/last/50";
    var xhttp = new XMLHttpRequest();
    xhttp.onreadystatechange = function () {
        if (this.readyState == 4 && this.status == 200) {
            var meta = {
                datetime: "11",
                headline: "11",
                headline: "11",
                source: "11",
                summary: "11",
                related: "11",
                url: "11",
            }

            callback({
                meta: meta,
                rows: JSON.parse(this.responseText),
                columns: Object.keys(meta),
            });
        }
    };
    xhttp.open("GET", API_URL, true)
    xhttp.send();
}
